import React from 'react';
import styles from 'styled-components';

const Form = styles.div`
    input: {
        width: 100px;
        height:20px;
    }
`

function Login() {
    return (
        <div>
            <form>
                <label htmlFor="">Username:</label>
                <input type="text"/>
            </form>
        </div>
    )
}

export default Login
